import React from "react";
import "./ExpenseItem.css";
function ExpenseItem() {
  return (
    <div>
      <div>June 22nd 2021</div>
      <div>
        <h2>Car Insurance</h2>
      </div>
    </div>
  );
}

export default ExpenseItem;
